import { Icon } from "@iconify/react";
import React from "react";
import { Col, Row } from "react-bootstrap";
// import { Container } from "react-bootstrap";

const About = () => {
  return (
    <div className="box">
      <Row>
        <Col xl={6}>
          <div className="about-img">
            <img src="./Images/cv.jpg" className="pc img-fluid" alt="pc" />
          </div>
          <div className="about-img-ab"></div>
        </Col>
        <Col xl={6}>
          <div className="about-info">
            <h5>
              Hello, I'm Shubham Chikhale, a recent graduate in BBA(CA) with a
              keen interest in Front-end Development and React. I have completed
              several online courses and have hands-on experience in creating
              web applications using React.
            </h5>
            <div style={{ marginTop: "20px" }} className="Projects">
              <a href="#Projects" className="nav-logo bbttn">
                Projects
                <Icon icon="ic:baseline-play-arrow" />
              </a>
            </div>
          </div>
        </Col>
      </Row>
    </div>
  );
};

export default About;
